demo.repl.help:
Verfügbare Befehle:
  @show              ─ letzte adaptive Kartenzusammenfassung anzeigen
  @json              ─ rohen JSON-Wert des Flows ausgeben
  @back              ─ zur vorherigen blockierten Karte/Eingaben zurück
  @input <k>=<v>     ─ Eingabefeld setzen oder überschreiben
  @click <action_id> ─ Karte mit der Aktion absenden
  @help              ─ diesen Hilfetext anzeigen
  @quit              ─ REPL beenden
